import React from 'react';
import styled from 'styled-components';

function NewExpense() {
	return (
		<Container>
			<div>
				<label>Title</label>
				<input type='text' />
			</div>
			<div>
				<label>Amount</label>
				<input type='number' />
			</div>
			<div>
				<label>Date</label>
				<input type='date' />
			</div>
		</Container>
	);
}

export default NewExpense;

const Container = styled.form`
	display: flex;
	flex-wrap: wrap;
	justify-content: center;
	align-items: center;
`;
